import React from 'react';
import { Button } from 'react-bootstrap';

const Square = (props) => {
  return (
    <div>
      <Button
        variant={"outline-light"}
        className="square"
        onClick={props.onClick}>
          {props.value}
      </Button>
    </div>
  );
}

export default Square;
